  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pea Island
  NWR outlines Refuge accomplishments during the 1969 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, furbearers, raptors, fish, reptiles, and diseases- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, and vegetation control. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  violations, and safety. N-R forms and photographs are attached.\",\n\t\"license_title\":
